(1, 40, 'One page', 'one-page', '', '<div class="slide_content oneColumn">\r\n<h1 class="vg-firstTitle">One page</h1>\r\n<h2 class="vg-secondTitle">Smoothing scroll</h2>\r\n<p id="excerpt">Detailed document and example data xml will help you to get started easily, if you are looking for this kind of theme just in time, please pay more attention to this theme and also consider purchase it, thanks in advance</p>\r\n<p id="btns"><a class="van_large_btn anchor" href="#section-works" target="_self" style="float: none; margin: auto; background: #55ac4a; color: #fff;">More Details</a></p>\r\n</div>', '', 0, 0, 0, 11, '2013-03-16 18:48:56', 63, '', '2013-04-05 04:40:34', 345, 0, '0000-00-00 00:00:00', '2013-03-16 18:48:56', '0000-00-00 00:00:00', '{"image_intro":"images\\/slideshow\\/1_bg.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, 6, '', '', 1, 32, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
