(37, 91, 'Zombies', 'zombies', '', '<p><span style="font-size: medium;"><strong><img src="images/product_categories/zombies_cat.png" border="0" style="float: left; padding-right: 10px;" />General Description</strong></span><strong><span style="font-size: medium;">:</span></strong> Zombies are animated mindless corpses with a powerful drive for feeding. In most cases, a virus is suspected to be the cause of the condition, but there are also reasons to believe that  metaphysical activities stand behind their creation. Reports seem to focus on those recently deceased turning into zombies, but- although less common-, reports exist on corpses rising from graves  they have inhabited for numbers of years. Also rare are instances of pets and other domesticated, or wild animals becoming reanimated to a zombie like state.         </p>\r\n<p><strong><span style="font-size: medium;">Combat</span><span style="font-size: medium;">:</span></strong><br /><span><strong>Strengths</strong></span><strong>:</strong> Zombies never stop pursuing the potential victim unless they are killed, or completely disabled. In some cases, they can be distracted but only before engaging the victim. One of their greatest strengths lies with their numbers. Usually they move in large groups which may compensate for any  weaknesses. Some reports,  mention  extreme muscle strength exceeding by far that of humans. Reports also record that religious artifacts and instruments (crosses, holy water, etc) have no effect against zombies.    <br /><strong>Weaknesses:</strong> The main weakness of zombies lies with their inability to move fast  and  their almost non existent  reflexes''. However, unsubstantiated reports exist describing fast moving and extremely agile zombie like creatures. Their intelligence is extremely limited to the point that is characterized as a basic feeding instinct. <br />Depending on the stage of decay, the skin, muscles,  and tissue of zombies can  be easily damaged.      <br /><br /><strong><span style="font-size: medium;">Habitat/Society</span><span style="font-size: medium;">:</span></strong><br /><strong>Appearance:</strong> Always depending on the level of decay, from a distance, zombie appearance may range from that of ordinary people to almost skeletons. Yet to the trained eye the movement of a zombie is unmistakably not human. Usually, if not always, zombie clothing is ragged and worn out taking the toll off their owners'' condition..<br /><br /><strong>Frequency:</strong> Zombie frequency is analogous to human concentrations. In big cities it is most possible, if not certain, that a large number of zombies will be encountered. This, however, may change as victims (food) becomes scarce. In time, zombies tend to wonder about in search of food usually in numbers making  large zombie concentrations a likely encounter almost anywhere.<br /><br /><strong>Organization:</strong> There is no known organized zombie group. Zombies tent to congregate in areas with a high volume of  noise which, in a way, they interpret as a food source.<br /><br /><strong>Intelligence:</strong> Their intelligence is extremely limited to the point that it is no more than a basic feeding instinct.<br /><br /><strong>Diet:</strong> Zombies will consume any warm blooded species whether humans, animals (domesticated or not), rodents, etc. There are reports that zombies, or at least a certain kind of zombies, hunt in particular for human brains.<br /><br /></p>\r\n<p><em><strong><br /><br />Disclaimer:</strong> </em><br />In case of ™ will not be held liable for any and all texts published. All texts in this category are based on popular culture, myths, legends and/or fairytales.<br /><br /> </p>', '', 1, 0, 0, 20, '2013-07-10 17:02:55', 63, '', '2014-03-23 15:00:39', 347, 0, '0000-00-00 00:00:00', '2013-07-10 17:02:55', '0000-00-00 00:00:00', '{"image_intro":"images\\/product_categories\\/zombies_cat.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"0","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":"1"}', 33, 0, 3, '', '', 1, 2115, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
