(38, 92, 'Vampires', 'vampires', '', '<p style="text-align: left;"><span style="font-size: medium;"><strong><img src="images/product_categories/vampires_cat.png" border="0" style="float: left; padding-right: 10px;" />General Description:</strong></span> Vampires are probably the most feared, the most dreadful of the undead creatures. One aspect that enhances this threat is that unlike other undead creatures, vampires can pass as normal human beings. Vampires prey without compassion or mercy upon the living. Traditionally, vampires must return to their coffins, or their "resting place" through daytime, thus avoiding daylight at all costs. According to myth and tradition besides feeding, vampires need to regenerate their powers. This can be achieved coming in contact with soil from their graves. A living creature can become a vampire by means of a curse and/or through a bite from vampire. Suspicions however exist that vampires are the product of a virus carrying the condition. <br />          <br /><strong><span style="font-size: medium;">Combat:</span></strong><br /><strong>Strengths:</strong> Vampires possess far superior physical strength than that of humans and can also move exceptionally fast in complete silence. Their abilities, however, do not end here. A human  unlucky enough to get caught in a "vampire''s gaze" will succumb to the vampire''s will. Vampires are also masters of evasion. Reports have them turning into bats, mist, or even completely disappearing into thin air in order to escape their pursuers. Vampires are almost indestructible, if not through very specific and in many instances ritualistic process.</p>\r\n<p style="text-align: left;">         <br /><strong>Weaknesses:</strong> A Vampire is a formidable opponent but there is still a good number of weaknesses that can be advantageous to the pursuer. Identifying a vampire is no easy task, however not an impossibility. Vampires do not cast shadows or reflections in mirrors, while animals, especially dogs and horses, are sensitive to their presence and react in an alarming way in vampire proximity. Also, vampires have an aversion to garlic, mirrors, and religious artifacts (crosses, bible, holy water, etc). Although crosses, garlic, and holy water can be used to stop a vampire from attacking or keep the creature to a distance they  do not cause actual or any excessive harm. A cross held with conviction and faith will keep vampires at bay, but will not disable them.  A Vampire can be killed exposed to direct sunlight or by driving a wooden stake through the heart. However,  be  aware that if the stake is removed the creature is restored to life. This means that additional  measures should be taken like for example having the creature also decapitated.              <br /><br /><strong><span style="font-size: medium;">Habitat/Society:    </span></strong>         <br /><strong>Appearance:</strong> Vampires can pass as normal human beings.  Differences from human beings  are very subtle. Vampires are cold to the touch, at least compared to an average human being, and they tend to have sharp facial features indicative of their feral nature.     <br /><br /><strong>Frequency:</strong>  According to estimates by vampire observers and hunters the ratio is 1 vampire to every 50.000 to 100.000 humans. So to an estimated 6 billion human population, there are 60.000 to 120.000 Vampires roaming in the world.   <br /><br /><strong>Organization:</strong> Although vampires can be solitary creatures,  usually they form groups or in some cases even larger societies. In those groups it is almost certain that there is a leader, (a master), obeyed by the other vampires in strict hierarchy down to a number of human servants usually mesmerized by the "vampire gaze". There are rumors of extremely large societies that reach  populations of small towns. These groups exist with in the proximity of large to very large human populations that are the main food supply and of course for blending in and remaining undetected. It is much easier to go unnoticed in a large city than in a village.<br /><br /><strong>Intelligence:</strong> Vampires are as intelligent as they were before they turned. Nevertheless, their intelligence grows with knowledge and experiences they accumulate  through the unending eons of their undying existence.  <br />        <br /><strong>Diet:</strong> According to tradition, vampires feed on fresh human blood, although there are cases of vampires feeding of energy (life energy). <br /><br /><br /><strong><em><br />Disclaimer:</em> </strong><br />In case of ™ will not be held liable for any and all texts published. All texts in this category are based on popular culture, myths, legends and/or fairytales.<br /><br /><br /><br /></p>', '', 1, 0, 0, 20, '2013-07-10 17:03:38', 63, '', '2014-02-24 12:37:40', 347, 0, '0000-00-00 00:00:00', '2013-07-10 17:03:38', '0000-00-00 00:00:00', '{"image_intro":"images\\/product_categories\\/vampires_cat.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 12, 0, 2, '', '', 1, 2300, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
