(39, 93, 'Werewolves', 'werewolves', '', '<p><span style="font-size: medium;"><strong><img src="images/product_categories/werewolves_cat.png" border="0" style="float: left; padding-right: 10px;" />General Description:</strong></span> Werewolves - a combination of wolf and human-  are fearsome creatures,. The history of the werewolf can be traced back to Ancient Greece (hence the term lycanthrope/λυκάνθρωπος or lycanthropy/λυκανθρωπία), to native American legends, through medieval Europe to our very modern times. The myths and legends describe werewolves in many different ways but three types are the most commonly encountered ones: the Shapeshifter, the Wolfman and the Werewolf. The Shapeshifter has the ability to change to werewolf and back at will and is able to keep its human higher functions (logic, emotions, strategy, goals,  etc). However, when in werewolf form is susceptible to instinct and bouts of rage that may cloud judgment. The Wolfman, is a creature that, either is a werewolf in a permanent state, or is human by day and a werewolf at night. When in werewolf state its behavior is beastlike, while according to myths, does not have recollections of its werewolf state. Finally the Werewolf is one of the most popular legends describing humans that always transform into werewolves during full moon. When in this state the creature is driven by uncontrollable rage. Just as the Wolfman, the Werewolf does not have recollections of its werewolf state.              <br /><br /><strong><span style="font-size: medium;">Combat:</span></strong><br /><strong>Strengths:</strong> Werewolves are massive creatures that by size alone can inspire incontrollable fear to their opponents. They posses far superior strength and agility than that of humans and they are also equipped with claws and strong jaws that can easily dismember a human. Furthermore they are persistent hunters of pray. Completing this terrifying creature, a werewolf cannot be killed easily by conventional ways, or weapons.      <br /><br /><strong>Weaknesses:</strong> Werewolves are tough opponents even to the most trained hunter and definitely unbeatable to the average human. However, unlike vampires, zombies, spirits, or other alike creatures, they can be wounded by regular weapons and ammo. Be warned that killing a Werewolf with conventional weapons and ammo is close to impossible, but it is possible to slow it down, avert an attack, or even temporarily disable it. The best way to kill a werewolf is to use pure silver, preferably in the form of bullets. The aim should be for the beast''s heart since pure silver will stop the beating instantly even if the projectile does not destroy the heart itself. Equipped with specially modified silver bullets that break into miniscule shrapnel,  you can kill the beast without the crucial difficulty of hitting the heart, since the shrapnel will enter the werewolf''s bloodstream and reach the heart.           <br /><br /><span style="font-size: medium;"><strong>Habitat/Society:</strong></span><br /><strong>Appearance:</strong> Do not fear! There in no possible way to mistake a werewolf when you see one. A typical werewolf is significantly taller and wider than an average male human. It carries a human like posture (standing on two legs, and exhibiting two arms) but is covered in fur and has wolf like ears and facial features. Reportedly, Werewolf eyes are glowing yellow or red.       <br /><br /><strong>Frequency:</strong> Most reports indicate that the werewolf population is very small (a few thousands worldwide). However, alarming rumors exist of a great numbers of werewolves have lived for centuries in very careful hiding -never seen by humans. (The reason for this is unknown).  <br /><br /><strong>Organization:</strong> According to legend werewolves are solitary creatures, in both human and werewolf states but there are also reports of organized werewolf societies   <br /><br /><strong>Intelligence:</strong> Werewolves are as intelligent as their human self but in the form of werewolf overtaken by rage and instinct they have no use for intelligence or judgment.<br />        <br /><strong>Diet:</strong> It is not known if the werewolf consume their prey. Usually they satisfy their hunger while in human form. Reports are contradictory in this area.<br /><br /><br /><br /><em><strong>Disclaimer:</strong> </em><br />In case of ™ will not be held liable for any and all texts published. All texts in this category are based on popular culture, myths, legends and/or fairytales.<br /><br /><br /><br /></p>', '', 1, 0, 0, 20, '2013-07-10 17:06:59', 63, '', '2014-03-28 16:59:55', 347, 0, '0000-00-00 00:00:00', '2013-07-10 17:06:59', '0000-00-00 00:00:00', '{"image_intro":"images\\/product_categories\\/werewolves_cat.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, 1, '', '', 1, 1175, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
