(55, 119, 'Terms & Conditions', 'terms-conditions', '', '<p><strong>In General</strong><br /><strong>In case of ™</strong> (“<strong>www.in-case-of.com</strong>”) owns and operate this Website.  This document governs your relationship with <strong>www.in-case-of.com</strong> (“Website”). Access to and use of this Website and the products and services available through this Website (collectively, the "Services") are subject to the following terms, conditions and notices (the "Terms of Service"). By using the Services, you are agreeing to all of the Terms of Service, as may be updated by us from time to time. You should check this page regularly to take notice of any changes we may have made to the Terms of Service.<br /><br />Access to this Website is permitted on a temporary basis, and we reserve the right to withdraw or amend the Services without notice. We will not be liable if for any reason this Website is unavailable at any time or for any period. From time to time, we may restrict access to some parts or all of this Website.<br />This Website may contain links to other websites, which are not operated by<strong> www.in-case-of.com</strong>. <strong>www.in-case-of.com</strong> has no control over the Linked Sites and accepts no responsibility for them or for any loss or damage that may arise from your use of them. Your use of the Linked Sites will be subject to the terms of use and service contained within each such site.<br /><br /><strong>Privacy Policy</strong><br />Our privacy policy, which sets out how we will use your information, can be found at <a href="index.php?option=com_content&amp;view=article&amp;id=56&amp;Itemid=195">Privacy Policy</a>. By using this Website, you consent to the processing described therein and warrant that all data provided by you is accurate.<br /><br /><strong>Prohibitions</strong><br />You must not misuse this Website. You will not: commit or encourage a criminal offense; transmit or distribute a virus, trojan, worm, logic bomb or any other material which is malicious, technologically harmful, in breach of confidence or in any way offensive or obscene; hack into any aspect of the Service; corrupt data; cause annoyance to other users; infringe upon the rights of any other person''s proprietary rights; send any unsolicited advertising or promotional material, commonly referred to as "spam"; or attempt to affect the performance or functionality of any computer facilities of or accessed through this Website. Breaching this provision would constitute a criminal offense and <strong>www.in-case-of.com</strong> will report any such breach to the relevant law enforcement authorities and disclose your identity to them.<br /><br />We will not be liable for any loss or damage caused by a distributed denial-of-service attack, viruses or other technologically harmful material that may infect your computer equipment, computer programs, data or other proprietary material due to your use of this Website or to your downloading of any material posted on it, or on any website linked to it.<br /><br /><strong>Intellectual Property, Software and Content</strong><br />The intellectual property rights in all software and content (including photographic images) made available to you on or through this Website remains the property of<strong> www.in-case-of.com</strong> or its licensors and are protected by copyright laws and treaties around the world. All such rights are reserved by <strong>www.in-case-of.com</strong> and its licensors. You may store, print and display the content supplied solely for your own personal use. You are not permitted to publish, manipulate, distribute or otherwise reproduce, in any format, any of the content or copies of the content supplied to you or which appears on this Website nor may you use any such content in connection with any business or commercial enterprise.<br /><br /><strong>Terms of Sale</strong><br />By placing an order you are offering to purchase a product on and subject to the following terms and conditions. All orders are subject to availability and confirmation of the order price.<br />Dispatch times may vary according to availability and subject to any delays resulting from postal delays or force majeure for which we will not be responsible. <br /><br />In order to contract with <strong>www.in-case-of.com</strong> you must be over 18 years of age and possess a valid credit or debit card issued by a bank acceptable to us. <strong>www.in-case-of.com</strong> retains the right to refuse any request made by you. If your order is accepted we will inform you by email and we will confirm the identity of the party which you have contracted with. This will usually be <strong>www.in-case-of.com</strong> or may in some cases be a third party. Where a contract is made with a third party <strong>www.in-case-of.com</strong> is not acting as either agent or principal and the contract is made between yourself and that third party and will be subject to the terms of sale which they supply you. When placing an order you undertake that all details you provide to us are true and accurate, that you are an authorized user of the credit or debit card used to place your order and that there are sufficient funds to cover the cost of the goods. The cost of foreign products and services may fluctuate. All prices advertised are subject to such changes.<br /><br />(a) Our Contract <br />When you place an order, you will receive an acknowledgement e-mail confirming receipt of your order: this email will only be an acknowledgement and will not constitute acceptance of your order. A contract between us will not be formed until we send you confirmation by e-mail that the goods which you ordered have been dispatched to you. Only those goods listed in the confirmation e-mail sent at the time of dispatch will be included in the contract formed.<br /><br />(b) Pricing and Availability<br />Whilst we try and ensure that all details, descriptions and prices which