cts) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation.<br /><br /><strong>Disclaimer of Liability</strong><br />The material displayed on this Website is provided without any guarantees, conditions or warranties as to its accuracy. Unless expressly stated to the contrary to the fullest extent permitted by law <strong>www.in-case-of.com</strong> and its suppliers, content providers and advertisers hereby expressly exclude all conditions, warranties and other terms which might otherwise be implied by statute, common law or the law of equity and shall not be liable for any damages whatsoever, including but without limitation to any direct, indirect, special, consequential, punitive or incidental damages, or damages for loss of use, profits, data or other intangibles, damage to goodwill or reputation, or the cost of procurement of substitute goods and services, arising out of or related to the use, inability to use, performance or failures of this Website or the Linked Sites and any materials posted thereon, irrespective of whether such damages were foreseeable or arise in contract, tort, equity, restitution, by statute, at common law or otherwise. This does not affect <strong>www.in-case-of.com''s</strong> liability for death or personal injury arising from its negligence, fraudulent misrepresentation, misrepresentation as to a fundamental matter or any other liability which cannot be excluded or limited under applicable law.<br /><br /><strong>Linking to this Website</strong><br />You may link to our home page, provided you do so in a way that is fair and legal and does not damage our reputation or take advantage of it, but you must not establish a link in such a way as to suggest any form of association, approval or endorsement on our part where none exists. You must not establish a link from any website that is not owned by you. This Website must not be framed on any other site, nor may you create a link to any part of this Website other than the home page. We reserve the right to withdraw linking permission without notice.<br /><br /><strong>Disclaimer as to ownership of trade marks, images of personalities and third party copyright</strong><br />Except where expressly stated to the contrary all persons (including their names and images), third party trade marks and content, services and/or locations featured on this Website are in no way associated, linked or affiliated with <strong>www.in-case-of.com</strong> and you should not rely on the existence of such a connection or affiliation. Any trade marks/names featured on this Website are owned by the respective trade mark owners. Where a trade mark or brand name is referred to it is used solely to describe or identify the products and services and is in no way an assertion that such products or services are endorsed by or connected to <strong>www.in-case-of.com</strong>.<br /><br /><strong>Indemnity</strong><br />You agree to indemnify, defend and hold harmless <strong>www.in-case-of.com</strong>, its directors, officers, employees, consultants, agents, and affiliates, from any and all third party claims, liability, damages and/or costs (including, but not limited to, legal fees) arising from your use this Website or your breach of the Terms of Service.<br /><br /><strong>Variation</strong><br /><strong>www.in-case-of.com</strong> shall have the right in its absolute discretion at any time and without notice to amend, remove or vary the Services and/or any page of this Website.<br /><br /><strong>Invalidity</strong><br />If any part of the Terms of Service is unenforceable (including any provision in which we exclude our liability to you) the enforceability of any other part of the Terms of Service will not be affected all other clauses remaining in full force and effect. So far as possible where any clause/sub-clause or part of a clause/sub-clause can be severed to render the remaining part valid, the clause shall be interpreted accordingly. Alternatively, you agree that the clause shall be rectified and interpreted in such a way that closely resembles the original meaning of the clause /sub-clause as is permitted by law.<br /><br /><strong>Complaints</strong><br />We operate a complaints handling procedure which we will use to try to resolve disputes when they first arise, please let us know if you have any complaints or comments.<br /><br /><strong>Waiver</strong><br />If you breach these conditions and we take no action, we will still be entitled to use our rights and remedies in any other situation where you breach these conditions.<br /><br /><strong>Entire Agreement</strong><br />The above Terms of Service constitute the entire agreement of the parties and supersede any and all preceding and contemporaneous agreements between you and <strong>www.in-case-of.com</strong>. Any waiver of any provision of the Terms of Service will be effective only if in writing and by a Director of <a href="http://www.in-case-of.com">www.in-case-of.com</a>.<br /><br /><br /><br /></p>', '', 1, 0, 0, 24, '2014-02-09 22:56:44', 63, '', '2014-02-10 18:26:43', 63, 0, '0000-00-00 00:00:00', '2014-02-09 22:56:44', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_