(56, 120, 'Privacy Policy', 'privacy-policy', '', '<p>This Privacy Policy governs the manner in which in case of ™ collects, uses, maintains and discloses information collected from users (each, a "User") of the in-case-of.com website ("Site"). This privacy policy applies to the Site and all products and services offered by in case of ™.<br /> <br /><strong>Personal identification information</strong> <br /><br />We may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, place an order and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number, credit card information, <br />Users may, however, visit our Site anonymously.<br /><br />We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.<br /> <br /><strong>Non-personal identification information</strong><br /><br /> We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.<br /> <br /><strong>Web browser cookies</strong><br /><br />In-case-of.com requires a browser that accepts “cookies”.  Cookies are used for adjusting a website’s content to fit a user’s preferences and optimize the website. Cookies are small files that a site or its service provider transfers to your computer''s hard drive through your Web browser (if you allow) that enables the site''s or service provider''s systems to recognize your browser and capture and remember certain information. For instance, we use session cookies to help us remember and process the items in your shopping cart which are used temporarily and expire once the website or browser is closed. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.<br />This web site uses Google Analytics, a web analyzing service of Google Inc. („Google“). Google Analytics uses so-called "cookies", i.e. text files stored on your computer and enabling analysis of how you use the web site. The information created by the cookie on how you use this web site (including your IP address) will be transferred to a Google server in the U.S. and stored there. Google will use this information to evaluate how you use the web site, to prepare reports on the web site activities for the web site operators and to perform other services in connection with web site and internet usage. Google may also transfer this information to third parties where required by law or to the extent that third parties will process this data on behalf of Google. Under no circumstances will Google align your IP address with any other Google data. You may select a respective setting to prevent the installation of the cookies. However, please be aware that in this case, you may not be able to use all functions of this web site to their full extent. By using this web site, you consent to the processing of the data recorded on you by Google in the way described above and for the purpose previously declared.<br /> <br /><strong>How we use collected information</strong><br /><br />in case of ™ collects and uses Users personal information for the following purposes:<br /><br />•   <em> To improve customer service</em><br />      Your information helps us to more effectively respond to your customer service requests and support needs.<br />•    <em>To personalize user experience</em><br />     We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.<br />•    <em>To improve our Site</em><br />     We continually strive to improve our website offerings based on the information and feedback we receive from you.<br />•   <em> To process transactions</em><br />     We may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside  <br />     parties except to the extent necessary to provide the service.<br />•    <em>To administer a content, promotion, survey or other Site feature</em><br />     To send Users information they agreed to receive about topics we think will be of interest to them.<br />•    <em>To send periodic emails</em><br /><br />The email address Users provide for order processing, will only be used to send them information and updates pertaining to their order. It may also be used to respond to their inquiries, and/or other requests or questions. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc. If at any time the User would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email or User may contact us via our Site.<br /><br />It is necessary for in case of ™  to maintain a minimal amount of personal information about our customers in order to provide appropriate products and services, as it is not possible to complete a purchase without providing some amount of personal information.<br /><br />At any time, you may advise us of which personal information you do not wish to share; however please be aware that the products and services we provide may be restricted as a result.<br /><br />If for any reason you no longer agree to the storing of your personal information or it has become incorrect, we will initiate the deletion or blocking of your data or implement the necessary corrections on your instruction (to the extent that this is feasible under applicable law). Upon request, you may receive information on all personal information we have stored on your person free of charge. <br /><br /><strong>How we protect your information<br /></strong><br />We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, transaction information and data stored on our Site.<br /><br />To ensure your details remain safe online. PayPal (SSL 128-bit encryption) handle all your online transactions.<br /><br />No information, electronic or otherwise, is made available to anyone other than fully authorized in case of ™ personnel.<br /><br /><strong>Compliance with children\\''s online privacy protection act</strong><br /><br />Protecting the privacy of the very young is especially important. For that reason, we never collect or maintain information at our Site from those we actually know are under 13, and no part of our website is structured to attract anyone under 13.<br /><br /><strong>Changes to this privacy policy</strong> <br /><br />in case of ™  has the discretion to update this privacy policy at any time. When we do, we revise the date at the bottom of this page,. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.<br /><br /><strong>Your acceptance of these terms</strong> <br /><br />By using this Site, you signify your acceptance of this policy and <a href="index.php?option=com_content&amp;view=article&amp;id=55&amp;Itemid=194">terms and conditions</a>. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.<br /> <br /><strong>Contacting us</strong> <br /><br />If you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us at:<br /><br />in case of ™ <br /><a href="http://www.in-case-of.com">www.in-case-of.com</a><br /><a href="mailto:ico@in-case-of.com">ico@in-case-of.com</a><br /><br /><br /></p>', '', 1, 0, 0, 24, '2014-02-10 18:24:30', 63, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-02-10 18:24:30', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 1, '', '', 1, 16997, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(57, 121, 'Demons', 'demons', '', '<p style="text-align: left;"><span style="font-size: medium;"><strong><img src="images/product_categories/demon_cat.png" border="0" width="320" height="320" style="float: left; padding-right: 10px;" />General Description:</strong></span> For innumerable eons, Demons have roamed our world. The word “Demon” derives from the Greek word “δαίμων/daimōn” which denotes a spirit or divine power that can have a powerful evil or benevolent effect upon humans.  In contemporary cultures/religions, the same word “Demon” is confined to its dark aspect as the true stigma of personified evil. According to myth and legend, Demons follow a strict hierarchy under Satan. Their power to possess living creatures makes them extremely dangerous and eventually harmful to humans that may become possessed, as well as those that are in their close proximity -loved ones, family, friends-.  Next to the simple pleasure of causing havoc and creating chaos, Demons might have other, “advanced” goals which depend on their nature and hierarchical classification. <br /><br /><strong><span style="font-size: medium;">Combat:</span></strong><br /><strong>Strengths:</strong> Demon powers depend upon hierarchical levels.  Low level demons can go as far as manipulating the vessel (possessed) and manifesting in terrifying, awesome forms.  Their attacks are usually limited to verbal threats, lies, deceptions, entrapments, and revelations of secrets and painful truths. Higher level demons can realize the above threats having acquired the power of direct physical attack or the ability of telekinesis. These types of demons are very resistant to exorcism. At the highest level, demons are almost invincible. It is not unlikely for the exorcist to get injured by the creature and/or the vessel (possessed) to be physically and mentally debilitated. In some rare cases, deaths have been reported.               <br /><br /><strong>Weaknesses:</strong> Demons can only exist in our plane through vessels and even then they have to abandon most of their powers. Once in our world, demons feel a strong aversion to religious artifacts, places of worship and people of the cloth. Demons also lack patience; they are susceptible to vanity and are often blinded by wrath. These traits can provide great advantages to an expert. The only way to drive the demon out of the vessel (possessed) is through exorcism. The ritual of exorcism aims to extract the evil demon spirit and abolish it back to hell avoiding as much as possible irreparable harm to the vessel. Armed with patience, persistence, faith, conviction, and the right tools an exorcist can almost unfailingly drive the evil spirit back to the depths of hell. <br /><br /><strong><span style="font-size: medium;">Habitat/Society: </span></strong> <br /><strong>Appearance:</strong> Since demons exist in our world through vessels (possessed humans), there is no way to identify a demon vs. a human from their appearance. Only behaviour can give out clues.<br /><br /><strong>Frequency:</strong> Unknown! Frequency information depends on successful exorcism performances, however we have no official statistical data on this practice. Estimates through exorcists and participants brings the number of performed exorcisms to about 10,000 or even 15,000 annually. Since the numbers refer to identified, captured, and exorcised demons, there is no way of even approximating the numbers of demons that roam the earth.<br /><br /><strong>Organization:</strong> Demons follow a strict hierarchy under their master, Satan. They are organized in legions ruled by legion lords. For example, Demons under Lord Beelzebub thrive in destruction, jealousy, and the spread of demon worship. Demons under Lord Baal or Berith seek to provoke murder and advance blasphemy. Demons under Lord Asmodeus provoke revenge, violence, and overwhelming lust.<br /><br /><strong>Intelligence:</strong> Demons are highly intelligent. They are experts in detecting weakness and use this ability to corrupt, confuse and defeat their opponent. On the other hand, as mentioned previously, demons lack patience, are susceptible to vanity and they are often blinded by wrath - traits that counteract their intelligence.<br /> <br /><br /><br /><strong><em><br />Disclaimer:</em> </strong><br />In case of ™ will not be held liable for any and all texts published. All texts in this category are based on popular culture, myths, legends and/or fairytales.<br /><br /><br /><br /></p>', '', 1, 0, 0, 20, '2014-02-10 19:36:55', 63, '', '2014-04-07 21:40:31', 63, 0, '0000-00-00 00:00:00', '2014-02-10 19:36:55', '0000-00-00 00:00:00', '{"image_intro":"images\\/product_categories\\/demon_cat.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 8, 0, 0, '', '', 1, 4777, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(58, 122, 'Return Policy', 'return-policy', '', '<p><br /><span style="font-size: medium;"><strong>All orders are non-refundable.</strong></span><br /><span style="font-size: medium;"><strong>Products damaged or showing signs of use are not returnable. Items missing will be subject to additional charges.</strong></span><br /><span style="font-size: medium;"><strong>All returned or exchanged products may be subject to inspection by in case of™.</strong></span><br /><br /><br /><span style="font-size: medium;"><strong>Defective products</strong></span><br /><br /><span style="font-size: small;"><strong>Defective products may be replaced.</strong></span><br /><br />Shipping damage or any other discrepancy, including wrong items (if due to in case of™ error) and/or missing items, should be reported to in case of™ within five (5) business days from delivery, in accordance to the RMA Policy guidelines described bellow.<br /> <br /><strong>Shipping charges</strong></p>\r\n<ul style="list-style-type: circle;">\r\n<li>Return product shipping charges are the responsibility of the customer.</li>\r\n<li>Replacement product shipping charges are the responsibility of in case of™.</li>\r\n</ul>\r\n<p> </p>\r\n<p><span style="font-size: medium;"><strong>Product exchange</strong></span><br /><br />A product may be exchanged for another product if replacement product is available.<br />The exchanged product may be subject to a 9% restocking fee.<br />The request for an exchange should be reported within five (5) business days from delivery, in accordance to the RMA Policy guidelines described bellow.    <br /><br /><span style="font-size: small;"><strong>Shipping charges</strong></span></p>\r\n<ul style="list-style-type: circle;">\r\n<li>Return product shipping charges are the responsibility of the customer.</li>\r\n<li>Replacement product shipping charges are the responsibility of the customer.</li>\r\n</ul>\r\n<p><span style="font-size: medium;"><strong>in case of ™ Return Merchandise Authorization (RMA) Policy</strong></span><br /><br /><span style="font-size: small;"><strong>Requesting an RMA number.</strong></span><br /><br />Send us an e-mail at ico@in-case-of.com and request a Return Merchandise Authorization (RMA) number. We will need the following information:<br /><br /></p>\r\n<ul style="list-style-type: disc;">\r\n<li>Purchaser/Business Name, order number and invoice number</li>\r\n<li>Product serial number</li>\r\n<li>Reason for return.\r\n<ul style="list-style-type: circle; padding-left: 30px;">\r\n<li>If defective, describe specifically what is wrong.</li>\r\n<li>If exchange, state the replacement product.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><br /><br />The request will be processed within three (3) business days and a reply will be send to you by in case of™, either including an RMA number or requesting further information or with the reasons of declining to issue an RMA number.<br /><br /><br /><span style="font-size: small;"><strong>Guidelines upon receiving an RMA number:</strong></span><br /><br />    Merchandise must be returned in the original packing.<br /><br />    Clearly mark the RMA number on the outside of the shipping box.<br /><br />    Include a copy of the original invoice in the package.<br /><br />    All merchandise must be shipped prepaid and fully insured to the address provided by in case of™ in the reply e-mail with the RMA number.<br /><br /><br /><br /><span style="font-size: medium;"><strong>Incomplete or unauthorized returns will be refused and will be returned to you.</strong></span></p>', '', 1, 0, 0, 24, '2014-02-19 23:28:18', 63, '', '2014-02-21 10:30:51', 63, 63, '2014-02-21 10:30:51', '2014-02-19 23:28:18', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 16, 0, 0, '', '', 1, 5022, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
