(10065, 'xDownloader alpha', 'plugin', 'xdownloader', 'content', 0, 1, 1, 0, '{"legacy":false,"name":"xDownloader alpha","type":"plugin","creationDate":"February 2012","author":"xrbyte","copyright":"Copyright (C) 2012 xrbyte.com. All rights reserved.","authorEmail":"xrbyte@live.com","authorUrl":"http:\\/\\/www.xrbyte.com","version":"1.0.1 alpha","description":"\\n\\t\\t<p>xDownloader alpha plugin for Joomla!<\\/p> \\n\\t\\t<p>Created to hide direct links on downloadable files.<\\/p> \\n\\t\\t<p>Convert plugin key to the url link in content to download file.<\\/p> \\n\\t\\t<p>Key syntax: {xdownloader title=[]|groups=[,]|filename=[]|filepath=[]}.<\\/p>\\n\\t\\t<p>Key variables separate by ''|''.<\\/p>\\n\\t\\t<p>Variable ''title'': optional variable, will be change on the ''filename'' variable or file name from ''filepath'' variable if ''title'' empty or absent from key.<\\/p> \\n\\t\\t<p>Variable ''groups'': optional variable, using to set permission on downloads. Value is the name of groups separate by '',''.<\\/p>\\n\\t\\t<p>Variable ''filename'': optional variable, set the name of downloadable file, possibly to use different name of original file name.<\\/p> \\n\\t\\t<p>Variable ''filepath'': necessary variable, must be full path of file on the server.<\\/p>\\n\\t\\t<p>Example: Some article content text {xdownloader title=Banana|groups=Registered,Author,Publisher|filename=bananas.jpg|filepath=\\/etc\\/www\\/images\\/sampledata\\/fruitshop\\/bananas_2.jpg}<\\/p> \\n\\t\\t<p>Plugin require installed xDownloader alpha or beta versions of components to correct work.<\\/p>\\n\\t","group":""}', '{}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
