les_cat4}</td>\r\n    </tr>\r\n  </table>\r\n{cat_info_end}\r\n<table border="0" cellspacing="2" cellpadding="5" width="100%" style=" background: #ffffff;">\r\n{checkbox_top}\r\n</table>\r\n{files}\r\n{form_hidden}\r\n<div style="text-align:right">{form_button}</div>', 0, 1, 'Here is a sample layout with 4 columns. When you will create your own layout with more then one columns, you must observe the rules. This can you find in the FAQ.', 4, 0, 0, '', 0, '0000-00-00 00:00:00');
