(1, 'mail@nomail.com', 'SimpleKey', 'mail@nomail.com', 'A new comment is posted', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml">\n<head>\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\n<title></title>\n</head>\n\n<body style="margin:0;padding:0;background:#ddd;">\n	<div style="width:100%;background:#ddd;margin:0;padding:50px 0 80px;color:#798796;font-family:''Lucida Grande'',Tahoma,Arial;font-size:12px;">\n\n	<center style="display:block;padding:30px 0">\n		<table cellpadding="0" cellspacing="0" border="0" style="width:590px;background:#fff;border:1px solid #b5bbc1;border-bottom-color:#9ba3ab;border-radius:4px;-moz-border-radius:4px;-webkit-border-radius:4px;">\n			<tbody>\n				<tr>\n					<td style="padding:20px;border-bottom:1px solid #b5bbc1;;background:#f5f5f5;border-radius:3px 3px 0 0;-moz-border-radius:3px 3px 0 0;-webkit-border-radius:3px 3px 0 0;">\n						Good day Super User,\n						<br /><br />\n						A new comment is posted on:						<br />\n						<a href="http://localhost/simplekey/simplekey/index.php/joomla-blog/14-audio/11-post-example" style="font-weight:bold;color:#477fda;text-decoration:none;font-size:16px;line-height:20px">Post Example</a>\n						<br />\n						<br />\n						Below is a snippet from the comment that has been posted.					</td>\n				</tr>\n				<tr>\n					<td style="padding:15px 20px;line-height:1.5;color:#555;font-family:''Lucida Grande'',Tahoma,Arial;font-size:12px;text-align:left">\n						<div style="display:inline-block;width:100%;padding-bottom:20px;">\n							<img src="http://www.gravatar.com/avatar.php?gravatar_id=d41d8cd98f00b204e9800998ecf8427e&amp;size=60&amp;d=mm" width="50" style="float:left;width:50px;height:auto;border-radius:3px;-moz-border-radius:3px;-webkit-border-radius:3px;" />\n							<div style="margin-left:60px">\n								<span style="font-weight:bold;color:#477fda;text-decor