(93, 'Pricing', '', '<div class="entry">\r\n<div class="pricetable">\r\n<div class="plan plan1">Basic\r\n<div class="price">$<span>3.59</span></div>\r\n<ul>\r\n<li>Free setup</li>\r\n<li>Unlimited bandwidth</li>\r\n<li>2.0% transaction fee</li>\r\n<li>1 GB Storage</li>\r\n<li>Unlimited concurrent domain</li>\r\n</ul>\r\n<a class="built-in-btn" href="#" target="_self">More</a></div>\r\n</div>\r\n<div class="pricetable">\r\n<div class="plan plan2">Personal\r\n<div class="price">$<span>10.59</span>/mo</div>\r\n<ul>\r\n<li>Free setup</li>\r\n<li>Unlimited bandwidth</li>\r\n<li>2.0% transaction fee</li>\r\n<li>1 GB Storage</li>\r\n<li>Unlimited concurrent domain uses</li>\r\n</ul>\r\n<a class="built-in-btn" href="#" target="_self">More</a></div>\r\n</div>\r\n<div class="pricetable">\r\n<div class="plan plan3">Advanced\r\n<div class="price">$<span>10.59</span>/mo</div>\r\n<ul>\r\n<li>Free setup</li>\r\n<li>Unlimited bandwidth</li>\r\n<li>2.0% transaction fee</li>\r\n<li>1 GB Storage</li>\r\n<li>Unlimited concurrent domain</li>\r\n</ul>\r\n<a class="built-in-btn" href="#" target="_self">More</a></div>\r\n</div>\r\n<div class="pricetable">\r\n<div class="plan plan4">Professional\r\n<div class="price">$<span>10.59</span>/mo</div>\r\n<ul>\r\n<li>Free setup</li>\r\n<li>Unlimited bandwidth</li>\r\n<li>2.0% transaction fee</li>\r\n<li>1 GB Storage</li>\r\n<li>Unlimited concurrent domain</li>\r\n</ul>\r\n<a class="built-in-btn" href="#" target="_self">More</a></div>\r\n</div>\r\n</div>', 1, 'pricing', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(94, 'My Pricing', '', '', 1, 'pricing', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_mypricing', 1, 0, '{"vgplan1_status":"1","vgplan1_name":"Basic","vgplan1_price":"3.59","vgplan1_content":"Free setup::\\r\\nUnlimited bandwidth::\\r\\n2.0% transaction fee::\\r\\n1 GB Storage::\\r\\nUnlimited concurrent domain","vgplan1_txtlink":"More","vgplan1_link":"#","vgplan2_status":"1","vgplan2_name":"Another","vgplan2_price":"12.24","vgplan2_content":"Free setup::\\r\\nUnlimited bandwidth::\\r\\n2.0% transaction fee::\\r\\n1 GB Storage::\\r\\nUnlimited concurrent domain","vgplan2_txtlink":"More","vgplan2_link":"#","vgplan3_status":"1","vgplan3_name":"Third One","vgplan3_price":"99.00","vgplan3_content":"Free setup::\\r\\nUnlimited bandwidth::\\r\\n2.0% transaction fee::\\r\\n1 GB Storage::\\r\\nUnlimited concurrent domain","vgplan3_txtlink":"More","vgplan3_link":"#","vgplan4_status":"1","vgplan4_name":"Last Plan","vgplan4_price":"175.00","vgplan4_content":"Free setup::\\r\\nUnlimited bandwidth::\\r\\n2.0% transaction fee::\\r\\n1 GB Storage::\\r\\nUnlimited concurrent domain","vgplan4_txtlink":"More","vgplan4_link":"#","moduleclass_sfx":"","vglayout":"_:default"}', 0, '*'),
(95, 'About', '', '', 1, 'about', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_lastworks', 1, 0, '{"vgcategories":["18"],"vgfilter":"any","vgorderingtype":"created","vgordering":"DESC","vgnumarticles":"1","moduleclass_sfx":"","vglayout":"incaseof:slide-about"}', 0, '*'),
(96, 'About Us - Text', '', '<div id="aboutheadings" style="text-align: center;">The Beginning</div>\r\n<p id="about-excerpt" style="text-align: center;">In case of wondering about us, we are two childhood buddies tracking down a  common dream.. Very early on, we found ourselves fascinated by the paranormal, the fantastic, science fiction, horror and in general by all aspects and expressions of this type of popular culture. As you can imagine the fascination was deep, strong and long-term! …<br /><br /></p>\r\n<div id="aboutheadings" style="text-align: center;">The Middle</div>\r\n<p id="about-excerpt" style="text-align: center;">In 2007, in a heated discussion over direct protection from zombies, we came up with the idea of a zombie emergency cabinet. This brilliant  idea remained an idea until 2010 when, not only did we built the actual cabinet, but we also came up with the greater idea of creating an actual company that would provide means against all possible cases of extraordinary hazard. Compared to the evolved cabinet samples you can view today on our site, that first cabinet stands a rough and  crude attempt, however also a symbol of "budhood", good cooperation and quality fun. From this humble beginning the project took off  exploring possibilities, establishing standards, and seeking improvements, so...<br /><br /></p>\r\n<div id="aboutheadings" style="text-align: center;">The Present</div>\r\n<p id="about-excerpt" style="text-align: center;">Today, we are proud to offer you products of high quality and craftsmanship. Throughout the manufacturing and assembly process, all individual components as well as the product as a unit are checked thoroughly for defects and/or deviations from our strict quality standards. <br /><br />Remember,  that  every cabinet is special and unique as no units are  the same. When you acquire an “in case of” product you know that it is one of a kind and that will never be exactly replicated.  Our products are crafted, painted, and finished by hand, also implementing hand operated power tools.<br /><br /></p>\r\n<div id="aboutheadings" style="text-align: center;">The Future</div>\r\n<p id="about-excerpt" style="text-align: center;"> Keep on making dreams come true…<br /><br /></p>', 1, 'about', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(97, 'Know Thine Enemy', '', '<p>Below are some critical information in order to know the<span class="product-field-desc"> Strengths &amp; Weaknesses of your Enemy!</span></p>\r\n<p id="btns"><a class="van_large_btn anchor" href="#section-works" target="_self" style="float: none; margin: auto; background: #5A5A5A; color: #fff;">More Details</a></p>', 1, 'skills', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":" entry","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
