(216, 'COM_FINDER_ADVANCED_TIPS', '<p>Here are a few examples of how you can use the search feature:</p><p>Entering <span class="term">this and that</span> into the search form will return results containing both "this" and "that".</p><p>Entering <span class="term">this not that</span> into the search form will return results containing "this" and not "that".</p><p>Entering <span class="term">this or that</span> into the search form will return results containing either "this" or "that".</p><p>Entering <span class="term">"this and that"</span> (with quotes) into the search form will return results containing the exact phrase "this and that".</p><p>Search results can also be filtered using a variety of criteria. Select one or more filters below to get started.</p>', '/home/incaseof/public_html/language/en-GB/en-GB.com_finder.ini'),
