INSERT INTO `ul5va_virtuemart_products_en_gb` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(3, 'The Zombie Cabinet.  You can kill your way to China with this one.', '<p>{tab=Cabinet}<br /><strong>The zombie outbreak emergency cabinet includes <span style="color: #ed1f24;">* </span>:</strong><br />1.    12 gauge short barrel shotgun<br />2.    Hunting knife with belt sheath<br />3.    Hand grenade<br />4.    Zombie outbreak field handbook<br />5.    10 shot gun shells box<br />6.    4 shot gun shells on leather belt holder<br />7.    Emergency hammer<br /><br /><span style="color: #ed1f24;">*</span> All included objects are non operational, non functional and for display purposes only. (See tab "Important Info")  <br />{tab=Content}<br /><strong>Content Description</strong><br />The zombie outbreak emergency cabinet is one of the best, if not the best, way to effectively protect you and your loved ones against a zombie attack. The stopping power and the disbursement of the 12 gauge short barrel shotgun is ideal for close quarters combat and taking down multiple targets at once. The hand grenade will provide an excellent way out when trapped or surrounded by large numbers of hostiles (zombies). (Use caution in handling.). When out of immediate danger, take time to read the zombie outbreak field handbook, probably the most important item in the zombie outbreak emergency cabinet.           <br />{tab=Product}<br /><strong>Product Description</strong><br /><strong>Zombie emergency cabinet</strong><br />•    Dimensions: <span lang="FR">H: 48cm / 18.89in , W: 48cm / 18.89in, D: 11.5cm / 4.52in</span><br />•    Approx. Weight:  4.7kg / 10.4lb<br />•    Case: sheet metal  <br />•    Included objects materials: plastic, paper, metal and fabric.<br /><br />o    Most objects are hand made(<span style="color: #ed1f24;">**</span>)<br />o    All painted objects are hand painted<br />o    Most objects are designed by "in case of" (<span style="color: #ed1f24;">***</span>)<br />o    Most objects are unique(<span style="color: #ed1f24;">**</span>)</p>\r\n<p><span style="color: #ed1f24;"><br />**</span>      except shotgun shells  <br /><span style="color: #ed1f24;">***</span>    except shotgun shells, hand grenade  <br /><br />{tab=Package}<br /><strong>Package includes</strong><br />•    Zombie emergency cabinet<br />•    Instructions and information manual<br />•    Wall-drywall mounting materials (screws, washers, etc)<br />•    Complimentary "in case of" sticker <br /><img src="images/stories/virtuemart/product/package_details.jpg" border="0" alt="" /><br />{tab=Important Info}<br /><strong>•</strong>Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <strong>•</strong>All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <strong>•</strong>All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation. <strong>•</strong>The shotgun replica is permanently attached to the back of the emergency cabinet. <strong>•</strong>The shotgun replica is made of solid plastic and has no moving parts or operational parts. <strong>•</strong>There is no possible way to be made operational or even to imitate the functions (loading, unloading, dry fire, etc) of an actual shotgun. <strong>•</strong>The shotgun replica has an orange barrel plug as required by law. <strong>•</strong>The knife is made of plastic with approximately an inch and a half of blade (also plastic). <strong>•</strong>The hand grenade is made of solid plastic with a keychain ring affix to it. It has no moving or operational parts and it cannot be made operational. <strong>•</strong>The shotgun shell box is an empty cardboard box. <strong>•</strong>The 4 shotgun shells are completely inert. There is no projectile, there is no powder and the there is no primer. For extra precaution the side of the casing that is not visible is severed (cut) along the length.<br />{/tabs}</p>\r\n<p><span style="color: #ed1f24;"> </span></p>', 'Zombie Cabinet', '', '', '', 'zombie-cabinet'),
(18, 'The Vampire Cabinet. Stick it to the heart!', '<p>{tab=Cabinet}</p>\r\n<p><strong>The vampire outbreak emergency cabinet includes <span style="color: #ed1f24;">* </span>:</strong><br />1. 2 vampire stakes<br />2. Heavy duty stake hammer<br />3. Large metal cross<br />4. Holy water container<br />5. 3 garlic heads<br />6. Vampire survival guide<br />7. Small  protective cross<br /><br /><span style="color: #ed1f24;">*</span> All included objects are non operational, non functional and for display purposes only. (see tab "Important Info") <br />{tab=Content} <br /><strong>Content Description</strong><br />The Vampire emergency cabinet is one of the finest ways to defend yourself from and engage a vampire. The most intimidating item for a vampire is the cross. In conjunction with strong faith, holy water and garlic can render a vampire immobile. For the kill, use the heavy duty stake hammer to strike the blessed vampire stake into the heart of the unholy…  <br />{tab=Product} <br /><strong>Product Description</strong><br /><strong>Vampire emergency cabinet</strong><br />• Dimensions: <span lang="FR">H: 48cm / 18.89in , W: 48cm / 18.89in, D: 11.5cm / 4.52in</span><br />• Approx. Weight:  4.7kg / 10.4lb<br />• Case: sheet metal <br />• Included objects materials: plastic, paper, metal and fabric.<br /><br />o All objects are hand made<br />o All painted objects are hand painted<br />o Most objects are designed by "in case of" (<span style="color: #ed1f24;">**</span>)<br />o All objects are unique</p>\r\n<p><span style="color: #ed1f24;">**</span> except garlic heads.<br />{tab=Package} <br /><strong>Package includes</strong><br />• Vampire emergency cabinet<br />• Instructions and information manual<br />• Wall-drywall mounting materials (screws, washers, etc)<br />• Complimentary "in case of" sticker</p>\r\n<p><img src="images/stories/virtuemart/product/package_details.jpg" border="0" alt="" /><br />{tab=Important Info}<br /><strong>•</strong>Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <strong>•</strong>All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <strong>•</strong>All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation.<br />{/tabs}</p>\r\n<p><span style="color: #ed1f24;"> </span></p>', 'Vampire Cabinet', '', '', '', 'vampire-cabinet'),
(19, 'The Werewolf Cabinet. Keep them in chains', '<p>{tab=Cabinet}<br /><strong>The werewolves (lycanthrope)  emergency cabinet includes <span style="color: #ed1f24;">*</span>:</strong><br />1. Navy caplock musket equipped with silver bayonet <br />2. 6 silver bullets on stand<br />3. Black powder flask<br />4. Protective amulet<br />5. Pouch containing silver bullets, wadding and percussion caps<br />6. Werewolf handbook<br /><br /><span style="color: #ed1f24;">*</span> All included objects are non operational, non functional and for display purposes only. (see tab "Important Info") <br />{tab=Content} <br /><strong>Content Description</strong><br />The werewolves (lycanthrope) emergency cabinet respects tradition, not only for the sake of tradition but also for the wisdom of true experience. Although a musket seems outdated, it  is one of the most effective  weapons against werewolves. The navy musket uses a high mass projectile that when penetrating skin,  it “pollutes” the werewolf’s blood stream with high levels of silver. The musket is also equipped with a silver bayonet to compensate for inaccuracy. So the musket in conjunction with the protective amulet serves its purpose to the fullest.        <br />{tab=Product} <br /><strong>Product Description</strong><br /><strong>Werewolves emergency cabinet</strong><br />• Dimensions: <span lang="FR">H: 48cm / 18.89in , W: 48cm / 18.89in, D: 11.5cm / 4.52in</span><br />• Approx. Weight:  4.4kg / 9.7lb<br />• Case: sheet metal <br />• Included objects materials: plastic, paper, metal and fabric.<br /><br />o All objects are hand made<br />o All painted objects are hand painted<br />o Most objects are designed by "in case of" (<span style="color: #ed1f24;">**</span>)<br />o All objects are unique</p>\r\n<p><span style="color: #ed1f24;">**</span> except Black powder flask<br />{tab=Package} <br /><strong>Package includes</strong><br />• Werewolves emergency cabinet<br />• Instructions and information manual<br />• Wall-drywall mounting materials (screws, washers, etc)<br />• Complimentary "in case of" sticker</p>\r\n<p><img src="images/stories/virtuemart/product/package_details.jpg" border="0" alt="" /><br />{tab=Important Info}<br /><strong>•</strong>Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <strong>•</strong>All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <strong>•</strong>All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation. <strong>•</strong>The navy cap lock musket replica is permanently attached to the back of the emergency cabinet. <strong>•</strong>The navy cap lock musket replica and the bayonet are made of plastic. It has no moving parts or operational parts. There is no possible way to be made operational or even to imitate the functions (loading, unloading, dry fire, etc) of an actual musket. <strong>•</strong>The navy cap lock musket replica has an orange barrel plug as required by law.<strong> •</strong>The silver bullets and the stand are made of plastic and are one piece. <strong>•</strong>The black powder flask is made of plastic. It is solid and does not contain and is impossible to contain any form of powder.<br />{/tabs}</p>\r\n<p><span style="color: #ed1f24;"> </span></p>', 'Werewolf Cabinet', '', '', '', 'werewolf-cabinet'),
(21, 'The Exorcism Cabinet. Throw Them To The Pits.', '<p>{tab=Cabinet}<br /><strong>The exorcism emergency cabinet includes <span style="color: #ed1f24;">* </span>:</strong><br />1.    Large cross<br />2.    Blessed protective cross<br />3.    Holly water container<br />4.    Bible<br />5.    Stole<br />6.    Sacred scroll of abolishment   <br />7.    10 ft. of constraining rope<br /><br /><span style="color: #ed1f24;">*</span> All included objects are non operational and non functional. The Emergency Cabinet is for display purposes only. (see tab "Important Info")  <br />{tab=Content}<br /><strong>Content Description</strong><br />The exorcism emergency cabinet provides the tools necessary to liberate the body, the spirit, and the soul of the possessed. The cross is a weapon and a shield against the powers of the Demon. Holy water is the tool that breaks the Demon''s concentration and of course the constraining rope keeps the Demon from unleashing a physical attack. Be warned! The Demon''s power is not limited to physical attack. Lies, painful truths, and deceitful accusations are also weapons in the evil arsenal. Arm yourself with faith and will power and silence the dark arsenal. Though faith may be your primary weapon hold fast to your Bible, the unbeatable ally breaking the Demons'' defenses. When vulnerable and weakened launch an attack with the scroll of abolishment. The scroll of abolishment is one, if not the most, powerful script/prayer against demons and unholy creatures. Use with caution due to its powerful nature.          <br />{tab=Product}<br /><strong>Product Description</strong><br /><strong>Exorcism emergency cabinet</strong><br />•    Dimensions: H: 48cm / 18.89in , W: 48cm / 18.89in, D: 11.5cm / 4.52in<br />•    Approx. Weight:  4.4kg / 9.7lb<br />•    Case: sheet metal  <br />•    Included objects materials: plastic, paper, metal and fabric.<br /><br />o    Most objects are hand made(<span style="color: #ed1f24;">**</span>)<br />o    All painted objects are hand painted<br />o    Most objects are designed by "in case of" (<span style="color: #ed1f24;">**</span>)<br />o    Most objects are unique(<span style="color: #ed1f24;">**</span>)</p>\r\n<p><span style="color: #ed1f24;"><br />**</span>      except constraining rope.<br />{tab=Package}<br /><strong>Package includes</strong><br />•    Exorcism emergency cabinet<br />•    Instructions and information manual<br />•    Wall-drywall mounting materials (screws, washers, etc)<br />•    Complimentary “in case of” sticker</p>\r\n<p><img src="images/stories/virtuemart/product/package_details.jpg" border="0" alt="" /><br />{tab=Important Info}<br /><strong>•</strong>Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <br /><strong>•</strong>All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <br /><strong>•</strong>All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation.<br />{/tabs}</p>\r\n<p><span style="color: #ed1f24;"> </span></p>', 'Exorcism Cabinet', '', '', '', 'exorcism-cabinet'),
(22, 'The Werewolf Cabinet. Keep them in chains', '<p>{tab=Cabinet}<br /><strong>The werewolves Mark II emergency cabinet includes <span style="color: #ed1f24;">*</span>:</strong><br />1. HP-IA (High Power - Increased Accuracy) musket equipped with silver bayonet <br />2. 4 silver rifled bullets on stand<br />3. Black powder flask<br />4. Protective amulet<br />5. Pouch containing silver bullets, wadding and percussion caps<br />6. Werewolf handbook<br /><br /><span style="color: #ed1f24;">*</span> All included objects are non operational, non functional and for display purposes only. (see tab "Important Info") <br />{tab=Content} <br /><strong>Content Description</strong><br />The werewolf Mark II emergency cabinet was developed with the experienced werewolf hunter in mind. The HP-IA musket is reinforced in order to hold twice as much gunpowder as regular muskets. This makes the HP-IA musket a weapon that employs extreme power and increased projectile velocity as well as accuracy. So the HP-IA musket, the silver high mass rifled projectiles (designed for high velocity, high impact and improved accuracy) in conjunction with the silver bayonet for CQC (close quarters combat) makes the Mark II emergency cabinet the perfect companion of the experienced werewolf hunter.         <br />{tab=Product} <br /><strong>Product Description</strong><br /><strong>Werewolves emergency cabinet</strong><br />• Dimensions: <span lang="FR">H: 48cm / 18.89in , W: 48cm / 18.89in, D: 11.5cm / 4.52in</span><br />• Approx. Weight:  4.4kg / 9.7lb<br />• Case: sheet metal <br />• Included objects materials: plastic, paper, metal and fabric.<br /><br />o All objects are hand made<br />o All painted objects are hand painted<br />o Most objects are designed by "in case of" (<span style="color: #ed1f24;">**</span>)<br />o All objects are unique</p>\r\n<p><span style="color: #ed1f24;">**</span> except Black powder flask<br />{tab=Package} <br /><strong>Package includes</strong><br />• Werewolves emergency cabinet<br />• Instructions and information manual<br />• Wall-drywall mounting materials (screws, washers, etc)<br />• Complimentary "in case of" sticker</p>\r\n<p><img src="images/stories/virtuemart/product/package_details.jpg" border="0" alt="" /><br />{tab=Important Info}<br /><strong>•</strong>Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <strong>•</strong>All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <strong>•</strong>All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation. <strong>•</strong>The musket replica is permanently attached to the back of the emergency cabinet. <strong>•</strong>The musket replica and the bayonet are made of plastic. It has no moving parts or operational parts. There is no possible way to be made operational or even to imitate the functions (loading, unloading, dry fire, etc) of an actual musket. <strong>•</strong>The silver bullets and the stand are made of plastic and are one piece. <strong>•</strong>The black powder flask is made of plastic. It is solid and does not contain and is impossible to contain any form of powder.<br />{/tabs}</p>\r\n<p><span style="color: #ed1f24;"> </span></p>', 'Werewolf Cabinet Mark II', '', '', '', 'werewolf-cabinet-19');
