(1, '<div id="aboutheadings" style="text-align: left;"><strong>Terms of Sale<br /></strong>By placing an order you are offering to purchase a product on and subject to the following terms and conditions. All orders are subject to availability and confirmation of the order price.<br />Dispatch times may vary according to availability and subject to any delays resulting from postal delays or force majeure for which we will not be responsible. <br /><br />In order to contract with <strong>www.in-case-of.com</strong> you must be over 18 years of age and possess a valid credit or debit card issued by a bank acceptable to us. <strong>www.in-case-of.com</strong> retains the right to refuse any request made by you. If your order is accepted we will inform you by email and we will confirm the identity of the party which you have contracted with. This will usually be <strong>www.in-case-of.com</strong> or may in some cases be a third party. Where a contract is made with a third party <strong>www.in-case-of.com</strong> is not acting as either agent or principal and the contract is made between yourself and that third party and will be subject to the terms of sale which they supply you. When placing an order you undertake that all details you provide to us are true and accurate, that you are an authorized user of the credit or debit card used to place your order and that there are sufficient funds to cover the cost of the goods. The cost of foreign products and services may fluctuate. All prices advertised are subject to such changes.<br /><br />(a) Our Contract <br />When you place an order, you will receive an acknowledgement e-mail confirming receipt of your order: this email will only be an acknowledgement and will not constitute acceptance of your order. A contract between us will not be formed until we send you confirmation by e-mail that the goods which you ordered have been dispatched to you. Only those goods listed in the confirmation e-mail sent at the time of dispatch will be included in the contract formed.<br /><br />(b) Pricing and Availability<br />Whilst we try and ensure that all details, descriptions and prices which appear on this Website are accurate, errors may occur. If we discover an error in the price of any goods which you have ordered we will inform you of this as soon as possible and give you the option of reconfirming your order at the correct price or cancelling it. If we are unable to contact you we will treat the order as cancelled. If you cancel and you have already paid for the goods, you will receive a full refund.<br />Delivery costs will be charged in addition; such additional charges are clearly displayed where applicable and included in the ''Total Cost''.<br /><br />(c) Payment <br />Upon receiving your order we carry out a standard authorization check on your payment card to ensure there are sufficient funds to fulfil the transaction. Your card will be debited upon authorisation being received. The monies received upon the debiting of your card shall be treated as a deposit against the value of the goods you wish to purchase. Once the goods have been despatched and you have been sent a confirmation email the monies paid as a deposit shall be used as consideration for the value of goods you have purchased as listed in the confirmation email.<br /><br /><strong>Disclaimers and information</strong><br /><br />Disclaimers: <br />The <strong>In case of ™</strong> products are for display purposes only. <br />In no event will <strong>In case of ™</strong> be liable for any use or misuse of the product beyond its intended purpose. <br />In no event will <strong>In case of ™</strong> be liable if the product is modified or tampered with in any way from its original state.  <br /><strong>Information:</strong><br />Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <br />All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <br />All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation.<br /><br /></div>\r\n<p style="text-align: left;"> </p>', '<p><strong>In General</strong><br /><strong>In case of ™</strong> (“<strong>www.in-case-of.com</strong>”) owns and operate this Website.  This document governs your relationship with <strong>www.in-case-of.com</strong> (“Website”). Access to and use of this Website and the products and services available through this Website (collectively, the "Services") are subject to the following terms, conditions and notices (the "Terms of Service"). By using the Services, you are agreeing to all of the Terms of Service, as may be updated by us from time to time. You should check this page regularly to take notice of any changes we may have made to the Terms of Service.<br /><br />Access to this Website is permitted on a temporary basis, and we reserve the right to withdraw or amend the Services without notice. We will not be liable if for any reason this Website is unavailable at any time or for any period. From time to time, we may restrict access to some parts or all of this Website.<br />This Website may contain links to other websites, which are not operated by<strong> www.in-case-of.com</strong>. <strong>www.in-case-of.com</strong> has no control over the Linked Sites and accepts no responsibility for them or for any loss or damage that may arise from your use of them. Your use of the Linked Sites will be subject to the terms of use and service contained within each such site.<br /><br /><strong>Privacy Policy</strong><br />Our privacy policy, which sets out how we will use your information, can be found at <a href="index.php?option=com_content&view=article&id=56&Itemid=195">Privacy Policy</a>. By using this Website, you consent to the