rdered have been dispatched to you. Only those goods listed in the confirmation e-mail sent at the time of dispatch will be included in the contract formed.<br /><br />(b) Pricing and Availability<br />Whilst we try and ensure that all details, descriptions and prices which appear on this Website are accurate, errors may occur. If we discover an error in the price of any goods which you have ordered we will inform you of this as soon as possible and give you the option of reconfirming your order at the correct price or cancelling it. If we are unable to contact you we will treat the order as cancelled. If you cancel and you have already paid for the goods, you will receive a full refund.<br />Delivery costs will be charged in addition; such additional charges are clearly displayed where applicable and included in the ''Total Cost''.<br /><br />(c) Payment <br />Upon receiving your order we carry out a standard authorization check on your payment card to ensure there are sufficient funds to fulfil the transaction. Your card will be debited upon authorisation being received. The monies received upon the debiting of your card shall be treated as a deposit against the value of the goods you wish to purchase. Once the goods have been despatched and you have been sent a confirmation email the monies paid as a deposit shall be used as consideration for the value of goods you have purchased as listed in the confirmation email.<br /><br /><br /><strong>Disclaimers and information</strong><br /><br />Disclaimers: <br />The <strong>In case of ™</strong> products are for display purposes only. <br /><br />In no event will <strong>In case of ™</strong> be liable for any use or misuse of the product beyond its intended purpose. <br /><br />In no event will <strong>In case of ™</strong> be liable if the product is modified or tampered with in any way from its original state.  <br /><br /><strong>Information:</strong><br />Each emergency cabinet is completely sealed and cannot be opened unless heavy force is used which will excessively damage the cabinet and the ornaments (objects) there in. <br />All ornaments (objects) within the cabinet are permanently affixed to the back of the cabinet with mechanical and chemical means. <br />All ornaments (objects) are non operational and they do not have any movable or operational parts and cannot be (objects or parts thereof) engineered into operation.<br /><br /><strong>Disclaimer of Liability</strong><br />The material displayed on this Website is provided without any guarantees, conditions or warranties as to its accuracy. Unless expressly stated to the contrary to the fullest extent permitted by law <strong>www.in-case-of.com</strong> and its suppliers, content providers and advertisers hereby expressly exclude all conditions, warranties and other terms which might otherwise be implied by statute, common law or the law of equity and shall not be liable for any damages whatsoever, including but without limitation to any direct, indirect, special, consequential, punitive or incidental damages, or damages for loss of use, profits, data or other intangibles, damage to goodwill or reputation, or the cost of procurement of substitute goods and services, arising out of or related to the use, inability to use, performance or failures of this Website or the Linked Sites and any materials posted thereon, irrespective of whether such damages were foreseeable or arise in contract, tort, equity, restitution, by statute, at common law or otherwise. This does not affect <strong>www.in-case-of.com''s</strong> liability for death or personal injury arising from its negligence, fraudulent misrepresentation, misrepresentation as to a fundamental matter or any other liability which cannot be excluded or limited under applicable law.<br /><br /><strong>Linking to this Website</strong><br />You may link to our home page, provided you do so in a way that is fair and legal and does not damage our reputation or take advan